import React from "react";

const SearchArea = (props) => {
  return (
    <div className="searchArea">
      <form action="">
        <input onChange={props.handleSearch} type="text"></input>
        <button type="submit">Search</button>
      </form>
    </div>
  );
};

export default SearchArea;
